import Navigation from './components/navigation/navigation';
import './App.css';
import Movies from './components/movies/Movies';


class App extends React.Component {
  constructor() {
    super()

  }

  render() {

    return (
      <>
        <Navigation />

        <Container>
  <Row>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col></Col>
  </Row>
</Container>

        <Movies />


      </>

    )



  }

}

export default App;
